  static const String aboutUsPartOne = "ARTICLE 1 : OBJET\nLes présentes conditions générales d'utilisation (dites « CGU ») ont pour objet l'encadrement juridique des modalités de mise à disposition de l'application et des services par « EPAVIE » et de définir les conditions d'accès et d'utilisation des services par « l'Utilisateur ».\nLes présentes CGU sont accessibles sur l'application à la rubrique « CGU ».\nToute inscription ou utilisation de l'application implique l'acceptation sans aucune réserve ni restriction des présentes CGU par l'Utilisateur. Lors de l'inscription sur l'application via le téléchargement, chaque utilisateur accepte expressément les présentes CGU en cochant la case précédant le texte suivant : « Je reconnais avoir lu et compris les CGU et je les accepte ».\nEn cas de non-acceptation des CGU stipulées dans le présent contrat, l'Utilisateur se doit de renoncer à l'accès des services proposés par l'application.\n« https://www.sendra.sn» se réserve le droit de modifier unilatéralement et à tout moment le contenu des présentes CGU.\n\nARTICLE 2 : MENTIONS LEGALES\nL'édition de l'application EPAVIE est assurée par la société La Sénégalaise de Déconstruction et de Recyclage Automobile SAS, société par actions simplifiées immatriculée au registre du commerce et du crédit mobilier sous le numéro SN DKR 2020B 10553, dont le siège social est situé à la  67, Cité SAGEF 1 Ouest Foire, Dakar – Sénégal\n\nARTICLE 3 : DEFINITIONS\nPour la compréhension et l'interprétation des termes contenus dans les CGU, qu'ils soient employés au singulier ou au pluriel, les Parties décident de se référer aux définitions suivantes :\nLes expressions ci-dessous auront la définition suivante :\n•	Application : désigne l'application EPAVIE\n•	CGU : Désigne les présentes Conditions Générales d'Utilisation ;\n•	Données à caractère personnel : toute information relative à une personne physique identifiée ou identifiable directement ou indirectement, par référence à un numéro d'identification ou à un ou plusieurs éléments, propres à son identité physique, physiologique, génétique, psychique, culturelle, sociale ou économique ;\n•	Réglementation sur les données personnelles : désigne la règlementation relative à la loi d'orientation sur la société sénégalaise de l'information (LOSI) n°2008-10 du 25 janvier 2008, adoptée pour définir les principes qui doivent gouverner l'utilisation des TIC dans les secteurs tels que la santé, l'éducation, l'administration, les télécommunications, etc.) ;\n•	Loi n° 2008-12 du 25 janvier 2008 portant sur la Protection des données à caractère personnel;\n•	Loi n° 2008-08 du 25 janvier 2008 sur les transactions électroniques;\n•	Loi n° 2008-11 du 25 janvier 2008 portant sur la Cybercriminalité;\n•	Parties : désigne conjointement EPAVIE et l'Utilisateur ;\n•	Services : désigne conjointement les Services mis à disposition des Utilisateurs par EPAVIE par le biais de l'application ;\n•	Utilisateur : désigne toute personne physique ou morale accédant et utilisant la plateforme, ses Services additionnels et ses Contenus, et après création d'un Compte personnel et acceptation des présentes CGU et notice d'information et de consentement de EPAVIE;\n•	SENDRA : désigne la Sénégalaise de Déconstruction et de Recyclage Automobile, éditrice de l'application au sens des reformes de la loi d'orientation sur la société sénégalaise de l'information (LOSI) n°2008- 10 du 25 janvier 2008 qui sont prévues ;\n•	Services additionnels : désigne l'ensemble des services accessibles mis à la disposition de l'Utilisateur par EPAVIE après création d'un Compte personnel à partir de la Plateforme EPAVIE.";

  static const String aboutUsPartTwo = "ARTICLE 4 : ACCÈS AU SITE\nL'Application permet d'accéder aux services suivants :\nD'obtenir les informations relatives aux activités et services de la société SENDRA. Également la possibilité de contacter SENDRA, via un formulaire de contact.\n4.1 Capacité\nL'Utilisation des Services est réservée aux Utilisateurs personnes physiques capables de souscrire des obligations conformément au droit Sénégalais ou par lequel il a été mandaté à cet effet.\nL'Utilisateur peut utiliser les Services pour le compte de tiers sur lesquels il dispose de l'autorité parentale ou pour lesquels il est reconnu tuteur ou curateur conformément au droit sénégalais. Les présentes CGU entrent en vigueur sans réserve à l'égard de l'Utilisateur au jour de son acceptation des présentes CGU.\n\nARTICLE 5 : ENTRÉE EN VIGUEUR ET DURÉE\nL'Utilisateur reconnaît que l'expression de son consentement est matérialisée par l'activation d'un bouton validé qui sera rendu actif après lecture complète des dites CGU.\nElles demeurent en vigueur à l'égard de l'Utilisateur pour toute la durée de la relation contractuelle avec SENDRA.\n\nARTICLE 6 : OBLIGATIONS ET RESPONSABILITÉ\n6.1 SENDRA\nSENDRA est tenue à une obligation de moyens dans le cadre de la mise à disposition de l'Application et de la fourniture des Services additionnels et Contenus.\nL'Utilisateur reconnaît que SENDRA ne pourra être tenue pour responsable de tout dommage matériel ou immatériel, direct ou indirect, quelles qu'en soient les causes (y compris les dommages pouvant être causés par l'éventuelle diffusion de virus, par la fraude informatique, du fait des contraintes et limites du réseau internet ou encore de la perte, de la détérioration ou de l'altération de fichiers) ni des conséquences résultant de :\n•	Son utilisation de l'Application, de ses Services additionnels et fonctionnalités et/ou de l'interprétation de ses Contenus ;\n•	L'impossibilité d'avoir accès à « l'Application », aux Services additionnels et Contenus, à l'exception des dommages directs consécutifs à une faute lourde ou intentionnelle.\n•	SENDRA s'engage à rendre, sauf cas de force majeure, ses Services disponibles 24 heures sur 24 et 7 jours sur 7, indépendamment des opérations de maintenance desdits Services et/ou de l'Application et de la plateforme. À ce titre, SENDRA est tenue à une obligation de moyens. SENDRA se réserve la possibilité d'interrompre, de suspendre momentanément ou de modifier sans préavis l'accès à tout ou partie des Services, afin d'en assurer la maintenance, ou pour tout autre raison, sans que l'interruption n'ouvre droit à aucune obligation ni indemnisation.\n6.2 L'utilisateur\nL'Utilisateur s'engage à :\n•	Utiliser «l'Application» et les Services de manière loyale, conformément à sa destination et dans le respect des lois et réglementations applicables, ainsi que des CGU,\n•	ne pas commercialiser tout ou partie des Services accessibles via la Plateforme,\n•	transmettre les informations signalées comme obligatoires au travers des Formulaires et ses coordonnées, dont il garantit qu'elles sont exactes, complètes et à jour,\n•	ne pas créer une fausse identité de nature à induire SENDRA ou les Tiers en erreur et à ne pas usurper l'identité d'une autre personne physique,\n•	mettre à jour ses informations personnelles en cas de modification,\n•	veiller à la sécurité de ses codes d'accès à la Plateforme,\n•	informer SENDRA en cas de dysfonctionnement technique ou de découverte d'une anomalie, telle que des intrusions.\nL'Utilisateur est seul responsable de l'utilisation qu'il fait de la Plateforme et des Services. L'utilisateur demeure pleinement et personnellement responsable de l'utilisation des Services additionnels du «l'Application » dans les conditions de droit commun. Il lui appartient notamment :\n•	d'utiliser «l'Application», ses Services additionnels et Contenus dans le respect des CGU et des dispositions légales et règlementaires en vigueur ;\n•	de ne pas commercialiser tout ou partie des Services additionnels ou contenus accessibles via «l'Application». En cas de non-respect d'une ou plusieurs dispositions des présentes CGU, l'accès à l'Application pourra être, unilatéralement, de plein droit et sans préavis, temporairement suspendu ou définitivement bloqué.";

  static const String aboutUsPartThree ="ARTICLE 7 : FORCE MAJEURE\nSENDRA ne sera pas tenue responsable en cas d'inaccessibilité à l'Application de ses Services additionnels et Contenus, causée par des évènements hors de son contrôle qui ne pouvaient être raisonnablement prévus et dont les effets ne peuvent être évités par des mesures appropriées, et empêchant l'exécution de ses obligations, au sens de la définition légale figurant à l'article 129 du COCC (« Cas de Force Majeure »). L'exécution des présentes CGU sera suspendue tant que durera le Cas de Force majeure, sauf si le retard en résultant justifie la résiliation de l'inscription de l'Utilisateur, et SENDRA s'efforcera dans la mesure du possible de faire cesser le Cas de Force Majeure ou de trouver une solution lui permettant d'exécuter ses obligations contractuelles malgré le Cas de Force Majeure. Si l'empêchement est définitif, l'Utilisateur pourra résiliée son compte.\nARTICLE 8 : DONNÉES À CARACTÈRE PERSONNEL\nLa politique de protection des Données à caractère personnel disponible sur le site de la SENDRA décrit les rôles et les obligations respectifs de l'Utilisateur et de SENDRA concernant le traitement des Données à caractère personnel dans le cadre de l'exécution des Services. En acceptant les présentes CU, l'Utilisateur et SENDRA s'engagent à respecter les termes et conditions dudit Accord.\nARTICLE 9 : LIENS HYPERTEXTES\nDes liens hypertextes peuvent être présents sur le site. L'Utilisateur est informé qu'en cliquant sur ces liens, il sortira du Site. Ce dernier n'a pas de contrôle sur les pages web sur lesquelles aboutissent ces liens et ne saurait, en aucun cas, être responsable de leur contenu.\nARTICLE 10 : COOKIES\nLors des visites sur l'Application, l'installation automatique d'un cookie sur le logiciel de navigation de l'Utilisateur peut survenir.\nLes cookies correspondent à de petits fichiers déposés temporairement sur le disque dur de l'ordinateur de l'Utilisateur. Ces cookies sont nécessaires pour assurer l'accessibilité et la navigation sur le site. Ces fichiers ne comportent pas d'informations personnelles et ne peuvent pas être utilisés pour l'identification d'une personne.\nL'information présente dans les cookies est utilisée pour améliorer les performances de navigation sur le Site.\nEn naviguant sur l'Application, l'Utilisateur accepte les cookies. Leur désactivation peut s'effectuer via les paramètres du logiciel de navigation.";

  static const String aboutUsPartFour ="ARTICLE 11 : PROPRIÉTÉ INTELLECTUELLE\nL'aspect général, les textes, vidéos, graphiques, logos, images et sons contenus dans cette Application EPAVIE sont, sauf mentions particulières, la propriété exclusive de la SENDRA. Cette Application constitue une œuvre protégée par la législation sénégalaise et internationale sur le droit d'auteur et la propriété intellectuelle. Les marques de la société SENDRA SAS sont des marques déposées. Toute représentation et/ou reproduction et/ou exploitation partielle ou totale de ces marques est donc prohibée. En conséquence, en application des dispositions du Code de la propriété intellectuelle, des dispositions législatives et réglementaires de tous pays et des conventions internationales, toute représentation et/ou reproduction et/ou exploitation partielle ou totale de cette Application ou d'un quelconque élément qui le compose est interdite de même que leur altération. A ce titre, il est notamment interdit à l'Utilisateur d'adapter, arranger, modifier, corriger, associer, traduire en toutes langues ou tous langages, mettre sur le marché à titre gratuit ou onéreux, commercialiser, tout ou partie des Services fournis par la SENDRA ou d'un quelconque élément qui les compose, quel qu'en soient le moyen et le support. Aucune stipulation des CGU ne peut être interprétée comme une cession de droits de propriété intellectuelle que ce soit tacitement ou d'une autre façon.\n\nARTICLE 12 : RENONCIATION\nLe fait pour l'une ou l'autre des Parties de ne pas se prévaloir d'une ou plusieurs stipulations des CGU ne pourra en aucun cas impliquer la renonciation par cette Partie à s'en prévaloir ultérieurement\n\nARTICLE 13 : NULLITÉ PARTIELLE\nDans le cas où certaines stipulations des CGU seraient inapplicables pour quelque raison que ce soit, y compris en raison d'une loi ou d'une réglementation applicable, les parties resteront liées par les autres stipulations des CGU et s'efforceront de remédier aux clauses inapplicables dans le même esprit que celui qui a présidé lors de la conclusion\n\nARTICLE 14 : DROIT APPLICABLE ET ATTRIBUABLE DE COMPÉTENCE\nLes CGU sont régies par le droit sénégalais.\nToutes difficultés relatives à la validité, l'application ou à l'interprétation des CGU seront soumises, à défaut d'accord amiable, au Tribunal de Commerce de Dakar, auquel les Parties attribuent compétence territoriale, quel que soit le lieu d'exécution ou le domicile du défendeur. Cette attribution de compétence s'applique également en cas de procédure en référé, de pluralité de défendeurs.";

